<li>点击链接<a href="https://developer.apple.com/documentation/storekit/in-app_purchase/original_api_for_in-app_purchase/validating_receipts_with_the_app_store" target="_blank" rel="noopener noreferrer">中文(通过 App Store 验证收据)</a></li>
